		<script>
			var regions = ['europe', 'america', 'asia'];

					}
				}
			});
			
			jQuery("path").mouseout(function(event){
				if (isWorldVisible) {
					if (currentSelectedRegion!=null) {
						var currentSelectedRegionCp = currentSelectedRegion;
						mouseEventTimeout = window.setTimeout(function() {

				}

			function extractRegion(elem) {
				var elemClasses = elem.getAttribute("class");
				if (elemClasses!=null) {
					for (var i=0; i<regions.length; i++) {
						if (elemClasses.indexOf(regions[i]+" ")>-1) {
							return regions[i];
						}
					}
				}
				return null;
			}
			
			function animate(i, scale, offsetX, offsetY, mapElem) {
					window.setTimeout(function(){
						mapElem.setAttribute("transform", "scale(" + scale + ","+ scale + ") translate(" + offsetX + "," + offsetY + ")");
					}, 40*i)
			}
			
			function drawPie( data ) {
				var sectors = [];
				var colors = [
					"green", "yellow", "red", "#DB4547"
				];

				var l = data.size / 2
				var a = 0 // Angle
				var aRad = 0 // Angle in Rad
				var z = 0 // Size z
				var x = 0 // Side x
				var y = 0 // Side y
				var X = 0 // SVG X coordinate
				var Y = 0 // SVG Y coordinate
				var R = 0 // Rotation

				var count = 0;
				
				data.sectors.map( function(item, key ) {
					a = 360 * item.percentage;
					aCalc = ( a > 180 ) ? 360 - a : a;
					aRad = aCalc * Math.PI / 180;
					z = Math.sqrt( 2*l*l - ( 2*l*l*Math.cos(aRad) ) );
					if( aCalc <= 90 ) {
						x = l*Math.sin(aRad);
					}
					else {
						x = l*Math.sin((180 - aCalc) * Math.PI/180 );
					}
					
					y = Math.sqrt( z*z - x*x );
					Y = y;

					
					if( a <= 180 ) {
						X = l + x;
						arcSweep = 0;
					}
					else {
						X = l - x;
						arcSweep = 1;
					}

					newSector.setAttributeNS(null, 'transform', ' translate('+ data.centerX + ',' + data.centerY + ') rotate(' + R + ', '+ l+', '+ l+')');
//					newSector.setAttributeNS(null, 'transform', 'rotate(' + R + ', '+ l+', '+ l+') translate('+ data.centerX + ',' + data.centerY + ')');

					document.getElementById("mapContainer").appendChild(newSector);

					jQuery("#mapContainer").append(rslt);	
					console.log(rslt);
*/
					R = R + a;
					count++;
				})
